import React, { Component } from 'react';

class Places extends Component {

  render() {
    const list = this.props.venues.map((venue,i)=> <li key={i}>{venue.name}</li>)
    return (
      <ol>
        {list}
      </ol>
    );
  }

}

export default Places;
